public class alibaba1 {

    public static void main(String[] args) {
        Scanner s = new Scanner(System.in);
        int n=s.nextInt(),m = s.nextInt();
        s.nextLine();
        String tar = s.nextLine();
        String[] dirty = new String[m];
        for(int i=0;i<m;i++){
            dirty[i] = s.nextLine();
        }
        long t1 = System.currentTimeMillis();
        System.out.println(ok(tar, dirty));
        long t2 = System.currentTimeMillis();
        System.out.println((t2-t1));
    }

    private static int ok(String tar, String[] dirty) {
        int res = 0;
        Map<String,Integer> map = new HashMap<>();
        for(String d:dirty){
            int count = 0;
            if(map.containsKey(d)) {
                count = map.get(d);
                res+=count;
                continue;
            }
            List<Integer> list = findFirst(tar,d.charAt(0));
            if(list.size()==0) continue;
            int[] tmp = getNext(d);
            int i = 0, tarpin = list.get(i++), dpin = 0;
            while(tarpin<tar.length()){
                if(dpin==-1||tar.charAt(tarpin)==d.charAt(dpin)){
                    tarpin++;dpin++;
                }else dpin = tmp[dpin];
                if(dpin==d.length()) {
                    count++;
                    dpin = 0;
                    if (i>=list.size()) break;
                    tarpin = list.get(i++);
                }
            }
            res += count;
            map.put(d,count);
        }
        return res;
    }

    private static List<Integer> findFirst(String tar, char c){
        List<Integer> res = new ArrayList<>();
        int i=0;
        while(i<tar.length()){
            if(tar.charAt(i)==c) res.add(i);
            i++;
        }
        return res;
    }

    private static int[] getNext(String a){
        int i=0,j=-1;
        int[] next = new int[a.length()];
        next[0] = -1;
        while(i<a.length()){
            if(j==-1||a.charAt(i)==a.charAt(j)){
                ++i;++j;
                if(i>=a.length()) break;
                if(a.charAt(i)!=a.charAt(j)){
                    next[i] = j;
                }else{
                    next[i] = next[j];
                }
            }else{
                j = next[j];
            }
        }
        return next;
    }
}


